export const TopBar = () => {
  const d = new Date();
  const day = d.getDay();

  return (
    <header className="flex jjustify-between w-10/12 bg-slate-900 font-medium text-3xl leading-10 rounded-b-3xl">
      <p className="text-white">This Platform is powered by ecolio CMS</p>
      <p>{day}</p>
    </header>
  );
};
